import React, { useState } from "react";

import Story from '../../components/Story';

import './Stories.scss';

const Stories = ({ stories, getUserHandler }) => {
  const [showStore, setShowStore] = useState(false);
  return (
    <React.Fragment>
      <section className="stories" data-testid="stories">
        <div className="container">

          {stories.map((storie)=> { console.log(storie); return <button className="user__thumb false" key={storie["id"]}><div className="user__thumb__wrapper"><img src={storie["videoUrl"]} alt="Bruce Wayne"/></div></button>})}



        </div>
      </section>

      {showStore && <Story></Story>}
    </React.Fragment>
  );
};

export default Stories;
